INSERT INTO `ebs_template` VALUES (1, 'Billing Statement', 'EBS Telkom', 'Telkom Billing Statement', '<p>\r\n	<title></title>\r\n</p>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"margin: 0px; padding: 0in; font-family: arial,sans-serif;\">\r\n				<div align=\"center\">\r\n					<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 6.25in;\" width=\"600\">\r\n						<tbody>\r\n							<tr>\r\n								<td style=\"margin: 0px; padding: 0in 0in 6pt; font-family: arial,sans-serif;\">\r\n									<p class=\"MsoNormal\">\r\n										<a href=\"http://www.telkom.co.id\"><img alt=\"e-Statement\" height=\"306\" src=\"cid:useetv\" width=\"598\" /></a></p>\r\n								</td>\r\n							</tr>\r\n						</tbody>\r\n					</table>\r\n				</div>\r\n				<div align=\"center\">\r\n					<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 6.25in;\" width=\"600\">\r\n						<tbody>\r\n							<tr>\r\n								<td style=\"margin: 0px; padding: 15pt; border: 1pt solid rgb(204, 204, 204); font-family: arial,sans-serif;\">\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\" width=\"100%\">\r\n										<tbody>\r\n											<tr>\r\n												<td style=\"margin: 0px; padding: 0in; font-family: arial,sans-serif;\" valign=\"top\">\r\n													<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\" width=\"100%\">\r\n														<tbody>\r\n															<tr>\r\n																<td style=\"margin: 0px; padding: 0in; font-family: arial,sans-serif;\" valign=\"top\">\r\n																	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\" width=\"100%\">\r\n																		<tbody>\r\n																			<tr>\r\n																				<td style=\"background: white; margin: 0px; padding: 0in; font-family: arial,sans-serif;\">\r\n																					<div>\r\n																						<p align=\"left\">\r\n																							<b><span style=\"font-family:; font-size: 9pt;\">PENTING. Bila belum menerima informasi tagihan Telkom Anda 7 (tujuh) hari sebelum tanggal jatuh tempo, harap hubungi CallCenter 147.</span></b><span style=\"font-family:; font-size: 9pt;\"> </span></p>\r\n																						<p align=\"left\">\r\n																							<span style=\"font-family:; font-size: 9pt;\">Pelanggan Yang Terhormat,<br />\r\n																							<br />\r\n																							Bersama ini kami kirimkan informasi tagihan Telkom anda , yang akan jatuh tempo pada tanggal <b>$batas_akhir</b>. Silakan gunakan password e-Statement Anda untuk membukanya.<br />\r\n																							<br />\r\n																							Password standar e-Statement adalah</span><b><span style=\"font-family:; font-size: 9pt;\"> 123456</span></b><span style=\"font-family:; font-size: 9pt;\"> </span></p>\r\n																						<p align=\"left\" class=\"MsoNormal\">\r\n																							<span style=\"font-family:; font-size: 9pt;\">Bagi Anda yang sebelumnya telah mengubah password standar e-Statement ke password pilihan Anda, Anda dapat terus menggunakan password yang sama untuk membuka lampiran e-Statement.</span><br />\r\n																							<br />\r\n																							<b><span style=\"font-family:; font-size: 9pt;\">Untuk membuka lampiran e-Statement, Anda membutuhkan Adobe Reader versi 7 atau versi yang lebih baru</span></b><span style=\"font-family:; font-size: 9pt;\">.<br />\r\n																							<a href=\"http://get.adobe.com/reader/\" target=\"_blank\"><span style=\"text-decoration: none;\"><img alt=\"Get ADOBE Reader\" border=\"0\" height=\"33\" src=\"cid:banner_adobe\" width=\"112\" /></span></a><br />\r\n																							<br />\r\n																							Untuk mengubah password&nbsp; <a href=\"http://www.ebs.co.id/ebs/gantipass/?nam=$mdiid&amp;jastel=$email_cust\"> klik disini</a>.<br />\r\n																							<br />\r\n																							Beberapa hal penting yang perlu Anda perhatikan untuk keamanan Informasi Billing Statement Anda : </span></p>\r\n																						<ul type=\"disc\">\r\n																							<li class=\"MsoNormal\" style=\"color: rgb(34, 68, 102);\">\r\n																								<p align=\"left\">\r\n																									<span style=\"font-family:; font-size: 9pt;\">Hati-hati pada penipuan yang mengatas-namakan PT Telkom.</span></p>\r\n																							</li>\r\n																							<li class=\"MsoNormal\" style=\"color: rgb(34, 68, 102);\">\r\n																								<p align=\"left\">\r\n																									<span style=\"font-family:; font-size: 9pt;\">Bila ada perubahan alamat, nomor telepon atau alamat e-mail, mohon hubungi Layanan Call Center 147.</span></p>\r\n																							</li>\r\n																						</ul>\r\n																						<p align=\"left\" class=\"MsoNormal\">\r\n																							<br />\r\n																							<span style=\"font-family:; font-size: 9pt;\">Terima Kasih,<br />\r\n																							<br />\r\n																							PT Telekomunikasi Indonesia, Tbk</span></p>\r\n																					</div>\r\n																				</td>\r\n																			</tr>\r\n																			<tr>\r\n																				<td style=\"margin: 0px; padding: 0in; font-family: arial,sans-serif;\">\r\n																					<p class=\"MsoNormal\">\r\n																						&nbsp;</p>\r\n																				</td>\r\n																			</tr>\r\n																			<tr>\r\n																				<td style=\"border-width: 1pt medium medium; border-style: solid none none; border-color: rgb(204, 204, 204) currentColor currentColor; margin: 0px; padding: 0in; font-family: arial,sans-serif;\">\r\n																					<p class=\"MsoNormal\">\r\n																						&nbsp;</p>\r\n																				</td>\r\n																			</tr>\r\n																		</tbody>\r\n																	</table>\r\n																</td>\r\n																<td style=\"margin: 0px; paddin