INSERT INTO `ebs_template` VALUES (19, 'Remainding', 'Tes Kalimantan', 'Telkom Billing Statement', '<div>\r\n	&nbsp;</div>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:719px;\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:600px;\" width=\"600\">\r\n					<tbody>\r\n						<tr>\r\n							<td>\r\n								<p>\r\n									<a href=\"http://www.telkom.co.id\"><img alt=\"e-Statement\" height=\"306\" src=\"cid:useetv\" width=\"598\" /></a></p>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n				<div style=\"clear:both;\">\r\n					&nbsp;</div>\r\n				<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:600px;\" width=\"600\">\r\n					<tbody>\r\n						<tr>\r\n							<td>\r\n								<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:554px;\" width=\"100%\">\r\n									<tbody>\r\n										<tr>\r\n											<td>\r\n												<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:550px;\" width=\"100%\">\r\n													<tbody>\r\n														<tr>\r\n															<td>\r\n																<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:332px;\" width=\"100%\">\r\n																	<tbody>\r\n																		<tr>\r\n																			<td>\r\n																				<p align=\"left\">\r\n																					PENTING. Bila belum menerima informasi tagihan Telkom Anda 7 (tujuh) hari sebelum tanggal jatuh tempo, harap hubungi CallCenter 147.</p>\r\n																				<p align=\"left\">\r\n																					Pelanggan Yang Terhormat,<br />\r\n																					<br />\r\n																					Bersama ini kami kirimkan informasi tagihan Telkom anda , yang akan jatuh tempo pada tanggal&nbsp;$batas_akhir. Silakan gunakan password e-Statement Anda untuk membukanya.<br />\r\n																					<br />\r\n																					Password standar e-Statement adalah&nbsp;123456</p>\r\n																				<p align=\"left\">\r\n																					Bagi Anda yang sebelumnya telah mengubah password standar e-Statement ke password pilihan Anda, Anda dapat terus menggunakan password yang sama untuk membuka lampiran e-Statement.<br />\r\n																					<br />\r\n																					Untuk membuka lampiran e-Statement, Anda membutuhkan Adobe Reader versi 7 atau versi yang lebih baru.<br />\r\n																					<a href=\"http://get.adobe.com/reader/\" target=\"_blank\"><img alt=\"Get ADOBE Reader\" border=\"0\" height=\"33\" src=\"cid:banner_adobe\" width=\"112\" /></a><br />\r\n																					<br />\r\n																					Untuk mengubah password&nbsp;&nbsp;<a href=\"http://www.ebs.co.id/ebs/gantipass/?nam=$mdiid&amp;jastel=$email_cust\">klik disini</a>.<br />\r\n																					<br />\r\n																					Beberapa hal penting yang perlu Anda perhatikan untuk keamanan Informasi Billing Statement Anda :</p>\r\n																				<ul>\r\n																					<li>\r\n																						<p align=\"left\">\r\n																							Hati-hati pada penipuan yang mengatas-namakan PT Telkom.</p>\r\n																					</li>\r\n																					<li>\r\n																						<p align=\"left\">\r\n																							Bila ada perubahan alamat, nomor telepon atau alamat e-mail, mohon hubungi Layanan Call Center 147.</p>\r\n																					</li>\r\n																				</ul>\r\n																				<p align=\"left\">\r\n																					<br />\r\n																					Terima Kasih,<br />\r\n																					<br />\r\n																					PT Telekomunikasi Indonesia, Tbk</p>\r\n																			</td>\r\n																		</tr>\r\n																		<tr>\r\n																			<td>\r\n																				<p>\r\n																					&nbsp;</p>\r\n																			</td>\r\n																		</tr>\r\n																		<tr>\r\n																			<td>\r\n																				<p>\r\n																			