INSERT INTO `ebs_template` VALUES (26, 'Remainding', 'Internet +1 BLN', 'Reminding Pembayaran Internet', '<p>\r\n	<img alt=\"\" src=\"cid:logo_telkom\" style=\"width: 161px; height: 121px;\" /></p>\r\n<div>\r\n	<p>\r\n		<span style=\"font-family: Arial, sans-serif;\">Yth Bapak/Ibu $nama_pelanggan<o:p></o:p></span></p>\r\n	<p>\r\n		<span style=\"font-family: Arial, sans-serif;\">Nomor Internet: $no_internet<o:p></o:p></span></p>\r\n	<p>\r\n		<span style=\"font-family: Arial, sans-serif;\">&nbsp; &nbsp;<o:p></o:p></span></p>\r\n	<p>\r\n		<span style=\"font-family: Arial, sans-serif;\">Kami sampaikan bahwa jumlah tagihan Internet&nbsp; Bapak/Ibu sampai dengan Bulan $bultag sebesar &nbsp;Rp.$tagihan terbilang $terbilang rupiah (belum termasuk biaya materai).<o:p></o:p></span></p>\r\n	<p>\r\n		<span style=\"font-family: Arial, sans-serif;\"><o:p>&nbsp;</o:p></span></p>\r\n	<p>\r\n		<span style=\"font-family: Arial, sans-serif;\">Mohon agar Bapak/Ibu melunasi tagihan tersebut melalui beberapa pilihan moda pembayaran &nbsp;seperti &nbsp;ATM, Indomart, Alfamart, Internet Banking, Mobile Banking, Loket Pembayaran Tagihan Telkom. Untuk pembayaran tagihan menggunakan Kartu Kredit dapat&nbsp; dilakukan melalui Apps MyIndihome.<o:p></o:p></span></p>\r\n	<p>\r\n		<span style=\"font-family: Arial, sans-serif; font-size: 12.8px;\">Sebagai info, batas bayar tagihan Internet adalah tanggal 20&nbsp;setiap bulannya.</span></p>\r\n	<p>\r\n		<span style=\"font-family: Arial, sans-serif;\">Karena sampai batas akhir masa bayar tersebut, Bapak/Ibu belum melakukan pembayaran, maka Telkom&nbsp; mengenakan denda sesuai ketentuan&nbsp; dan melakukan pemblokiran sambungan layanan Internet Bapak/Ibu.</span></p>\r\n	<p>\r\n		<span style=\"font-family: Arial, sans-serif;\">Mohon abaikan pemberitahuan ini bila Bapak/Ibu telah melakukan pembayaran. Email ini bersifat informasi dan tidak dapat di-reply, jika ada hal lain yang ingin Bapak/Ibu &nbsp;tanyakan tentang layanan Telkom dapat menghubungi kami