INSERT INTO `ebs_template` VALUES (33, 'Indihome', 'Reminder Indihome N+', 'Reminding Pembayaran Indihome', '<p>\r\n	<img alt=\"\" src=\"cid:logo_telkom\" style=\"width: 161px; height: 121px;\" /></p>\r\n<p style=\"font-size: 12.8px;\">\r\n	Yth Bapak/Ibu $nama_pelanggan</p>\r\n<p style=\"font-size: 12.8px;\">\r\n	Nomor IndiHome: $no_internet</p>\r\n<p style=\"font-size: 12.8px;\">\r\n	&nbsp; &nbsp;</p>\r\n<p style=\"font-size: 12.8px;\">\r\n	Kami sampaikan bahwa jumlah tagihan Indihome &nbsp;Bapak/Ibu sampai dengan Bulan $bultag sebesar &nbsp;Rp.$tagihan terbilang $terbilang rupiah (belum termasuk biaya materai).</p>\r\n<p style=\"font-size: 12.8px;\">\r\n	&nbsp;</p>\r\n<p style=\"font-size: 12.8px;\">\r\n	Mohon agar Bapak/Ibu melunasi tagihan Indihome tersebut melalui beberapa pilihan moda pembayaran &nbsp;seperti &nbsp;ATM, Indomart, Alfamart, Internet Banking, Mobile Banking, Loket Pembayaran Tagihan Telkom. Untuk pembayaran tagihan menggunakan Kartu Kredit dapat&nbsp; dilakukan melalui Apps MyIndihome.</p>\r\n<p style=\"font-size: 12.8px;\">\r\n	<span style=\"font-size: 12.8px;\">Sebagai info, batas bayar tagihan Indihome adalah tanggal 20&nbsp;</span><span style=\"font-size: 12.8px;\">setiap bulannya&nbsp;</span><span style=\"font-size: 12.8px;\">.</span></p>\r\n<p style=\"font-size: 12.8px;\">\r\n	Karena sampai batas akhir masa bayar tersebut, Bapak/Ibu belum melakukan pembayaran, maka Telkom&nbsp; mengenakan denda sesuai ketentuan&nbsp; dan melakukan pemblokiran sambungan layanan Indihome Bapak/Ibu.</p>\r\n<p style=\"font-size: 12.8px;\">\r\n	Mohon abaikan pemberitahuan ini bila Bapak/Ibu telah melakukan pembayaran. Email ini bersifat informasi dan tidak dapat di-reply, jika ada hal lain yang ingin Bapak/Ibu &nbsp;tanyakan tentang layanan Telkom dapat menghubungi kami melalui :</p>\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"font-size: 12.8px; width: 500px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<span style=\"font-size: 12.8px;\">Co