INSERT INTO `ebs_template` VALUES (35, 'Indihome', 'indihome_claim', 'Ralat Informasi Tagihan', '<div dir=\"auto\">\r\n	<div dir=\"auto\">\r\n		Pelanggan Indihome nomor $no_internet yang terhormat,</div>\r\n	<div dir=\"auto\">\r\n		&nbsp;</div>\r\n	<div dir=\"auto\">\r\n		Berdasarkan info tagihan/EBS yang kami kirim, &nbsp;terdapat komponen billing layanan Indihome Transvision yg belum ditagihkan pada tagihan bulan juli 2017.</div>\r\n	<div dir=\"auto\">\r\n		&nbsp;</div>\r\n	<div dir=\"auto\">\r\n		Sehubungan dengan hal tersebut, kami infokan adanya penyesuaian tagihan bulan Juli 2017 menjadi sebesar Rp. $tagihan terbilang $terbilang (belum termasuk biaya materai) sesuai dengan paket &nbsp;transvision yang telah Anda nikmati.</div>\r\n	<div dir=\"auto\">\r\n		&nbsp;</div>\r\n	<div dir=\"auto\">\r\n		Kami tegaskan bahwa penyesuaian ini bukan merupakan kenaikan tagihan terhadap tagihan bulan Juni 2017. Total tagihan bulan Juli sama besarnya dengan tagihan bulan sebelumnya, kecuali jika ada perubahan layanan.</div>\r\n	<div dir=\"auto\">\r\n		&nbsp;</div>\r\n	<div dir=\"auto\">\r\n		Untuk informasi lebih lanjut silahkan menghubungi Contact Center 147 atau Plasa terdekat.</div>\r\n	<div dir=\"auto\">\r\n		&nbsp;</div>\r\n	<div dir=\"auto\">\r\n		Mohon maaf atas ketidaknyamanannya dan terima kasih telah memilih Telkom.</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', NULL, '<div dir=\"auto\">\r\n	<div dir=\"auto\">\r\n		Pelanggan Indihome nomor $no_internet yang terhormat,</div>\r\n	<div dir=\"auto\">\r\n		&nbsp;</div>\r\n	<div dir=\"auto\">\r\n		Berdasarkan info tagihan/EBS yang kami kirim, &nbsp;terdapat komponen billing layanan Indihome Transvision yg belum ditagihkan pada tagihan bulan juli 2017.</div>\r\n	<div dir=\"auto\">\r\n		&nbsp;</div>\r\n	<div dir=\"auto\">\r\n		Sehubungan dengan hal tersebut, kami infokan adanya penyesuaian tagihan bulan Juli 2017 menjadi sebesar Rp. $tagihan terbilang $terbilang (belum termasuk biaya materai) sesuai dengan paket &nbsp;transvision yang telah Anda nikmati.</div>\r\n	<div dir=\"auto\">\r\n		&nbsp;</div>\r\n	<div dir=\"auto\">\r\n		Kami tegaskan bahwa penyesuaian ini bukan merupakan kenaikan tagihan terhadap tagihan bulan Juni 2017. Total tagihan bulan Juli sama besarnya dengan tagihan bulan sebelumnya, kecuali jika ada perubahan layanan.</div>\r\n	<div dir=\"auto\">\r\n		&nbsp;</div>\r\n	<div dir=\"auto\">\r\n		Untuk informasi lebih lanjut silahkan menghubungi Contact Center 147 atau Plasa terdekat.</div>\r\n	<div dir=\"auto\">\r\n		&nbsp;</div>\r\n	<div dir=\"auto\">\r\n		Mohon maaf atas ketidaknyamanannya dan terima kasih telah memilih Telkom.</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', '', 'Aktif', NULL);
