INSERT INTO `ebs_template` VALUES (41, 'Remainding', 'Paynow reminding', 'Informasi Maintenance Link Pembayaran \"Paynow\"', '<div>\r\n	<div>\r\n		Yth Bapak/Ibu&nbsp;$nama_pelanggan</div>\r\n	<div>\r\n		<span style=\"font-size: 12.8px;\">Nomor Internet : $ncli</span></div>\r\n</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Kami ucapkan terima kasih atas kepercayaan dan kesediaan Bapak/Ibu untuk berlangganan layanan IndiHome Telkom yang merupakan layanan Triple Play (terdiri dari Telepon, Internet dan IPTV).</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Melalui email ini, kami sampaikan bahwa menu bayar paynow di info tagihan saat ini tidak berfungsi, untuk selanjutnya silahkan melakukan pembayaran melalui moda pembayaran lainnya.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Untuk kemudahan pembayarannya Telkom menyediakan beberapa moda pembayaran melalui kerjasama dengan pihak Perbankan seperti Autodebet (autodebet dari rekening tabungan atau Autodebet Kartu Kredit), Mobile banking (Internet banking, SMS banking dan Phone banking) maupun ATM.</div>\r\n<div>\r\n	Selain moda pembayaran perbankan, pembayaran tagihan IndiHome dapat juga dilakukan di IndoMart, Alfamart, e-Commerce (Tokopedia, Bukalapak, Traveloka, Blanja.com, Gojek).</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Untuk pembayaran tagihan dengan Kartu Kredit dapat dilakukan melalui aplikasi myIndiHome. Silahkan unduh aplikasi myIndiHome di Android https://goo.gl/H7xzYk - di IOS https://goo.gl/va3a1E.</div>\r\n', NULL, '<div>\r\n	<div>\r\n		Yth Bapak/Ibu&nbsp;$nama_pelanggan</div>\r\n	<div>\r\n		<span style=\"font-size: 12.8px;\">Nomor Internet : $ncli</span></div>\r\n</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Kami ucapkan terima kasih atas kepercayaan dan kesediaan Bapak/Ibu untuk berlangganan layanan IndiHome Telkom yang merupakan layanan Triple Play (terdiri dari Telepon, Internet dan IPTV).</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Melalui email ini, kami sampaikan bahwa menu bayar paynow di info tagihan saat ini tidak berfungsi, untuk selanjutnya silahkan melakukan pembayaran melalui moda pembayaran lainnya.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Untuk kemudahan pembayarannya Telkom menyediakan beberapa moda pembayaran melalui kerjasama dengan pihak Perbankan seperti Autodebet (autodebet dari rekening tabungan atau Autodebet Kartu Kredit), Mobile banking (Internet banking, SMS banking dan Phone banking) maupun ATM.</div>\r\n<div>\r\n	Selain moda pembayaran perbankan, pembayaran tagihan IndiHome dapat juga dilakukan di IndoMart, Alfamart, e-Commerce (Tokopedia, Bukalapak, Traveloka, Blanja.com, Gojek).</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Untuk pembayaran tagihan dengan Kartu Kredit dapat dilakukan melalui aplikasi myIndiHome. Silahkan unduh aplikasi myIndiHome di Android https://goo.gl/H7xzYk - di IOS https://goo.gl/va3a1E.</div>\r\n', '', 'Aktif', NULL);
