&nbsp;lokal).                                                </div>\r\n                                            </li>\r\n                                            <li class=\"style7\">\r\n                                                <div align=\"justify\">\r\n                                                    Dimohon kepada&nbsp;pelanggan untuk tidak&nbsp;memberikan tips kepada&nbsp;petugas pemasangan/perbaikan&nbsp;telepon&nbsp;/IndiHome, karena layanan&nbsp;yang diberikan petugas&nbsp;sudah sesuai dengan aturan&nbsp;yang berlaku.                                                </div>\r\n                                            </li>\r\n                                        </ol>                                    </td>\r\n                                    <td width=\"10\" valign=\"top\">\r\n                                        <p>&nbsp;                                        </p>\r\n                                        <p>&nbsp;                                        </p>                                    </td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td>&nbsp;                                    </td>\r\n                                    <td valign=\"top\"><hr width=\"100%\" />\r\n									 <table width=\"764\" border=\"0\">\r\n                                          <tr>\r\n                                            <th colspan=\"2\" class=\"style3\" scope=\"col\"><div align=\"left\">*Ketentuan Denda </div></th>\r\n                                            <th width=\"10\" class=\"style3\" scope=\"col\">&nbsp;</th>\r\n                                            <th width=\"445\" class=\"style3\" scope=\"col\">&nbsp;</th>\r\n                                          </tr>\r\n                                          <tr>\r\n                                            <td width=\"22\" class=\"style3\"><div align=\"center\">1.</div></td>\r\n                  