INSERT INTO `ebs_template` VALUES (55, 'Materai', 'Materai Indihome', 'Informasi Tarif Bea Materai mulai 1 Januari 2021 ', '<p>\r\n  <img alt=\"\" src=\"cid:logo_telkom\" style=\"width: 161px; height: 121px;\" /></p>\r\n<p>Terima kasih telah memilihIndiHomeuntuk memenuhi kebutuhan digital Anda dankeluarga.<u></u><u></u></p>\r\n<p>Sesuai dengan Undang-Undang Republik Indonesia No. 10 Tahun 2020 tentang Bea Meterai,<br>\r\n  berikut kami sampaikan informasi perubahan ketentuan pembebananBea Meteraiatas pembayaran<br>\r\n  tagihanIndiHome:<u></u><u></u></p>\r\n<table width=\"483\" border=\"1\" cellpadding=\"0\" cellspacing=\"3\">\r\n  <tbody>\r\n    <tr>\r\n      <td width=\"223\" rowspan=\"2\" bgcolor=\"#CCCCCC\"><p align=\"center\"><strong>Jumlah Pembayaran<u></u><u></u></strong></p></td>\r\n      <td width=\"223\" colspan=\"2\" bgcolor=\"#CCCCCC\"><p align=\"center\"><strong>Ketentuan Bea Meterai<u></u><u></u></strong></p></td>\r\n    </tr>\r\n    <tr>\r\n      <td width=\"102\" bgcolor=\"#CCCCCC\"><p align=\"center\"><strong>Lama<u></u><u></u></strong></p></td>\r\n      <td width=\"119\" bgcolor=\"#CCCCCC\"><p align=\"center\"><strong>Baru<u></u><u></u></strong></p></td>\r\n    </tr>\r\n    <tr>\r\n      <td width=\"223\"><p>s.d Rp.250.000,-<u></u><u></u></p></td>\r\n      <td width=\"102\"><p>Tidak dikenakan<u></u><u></u></p></td>\r\n      <td width=\"119\"><p>Tidak dikenakan<u></u><u></u></p></td>\r\n    </tr>\r\n    <tr>\r\n      <td width=\"223\"><p>Rp.250.001,- s.d. Rp. 1.000.000,-<u></u><u></u></p></td>\r\n      <td width=\"102\"><p>Rp. 3.000,-<u></u><u></u></p></td>\r\n      <td width=\"119\"><p>Tidak dikenakan<u></u><u></u></p></td>\r\n    </tr>\r\n    <tr>\r\n      <td width=\"223\"><p>Rp. 1.000.001,- s.d. Rp. 5.000.000,-<u></u><u></u></p></td>\r\n      <td width=\"102\"><p>Rp. 6.000,-<u></u><u></u></p></td>\r\n      <td width=\"119\"><p>Tidak dikenakan<u></u><u></u></p></td>\r\n    </tr>\r\n    <tr>\r\n      <td width=\"223\"><p>di atas Rp. 5.000.000,-<u>